import React from "react";
import { BrowserRouter as Router} from 'react-router-dom';
import Navigation from '../navigation';
const App = () => (
	<div>
		<Router>
			<Navigation/>
		</Router>
		<h1>App</h1>
	</div>
);

export default App;
